Answer: You can use the `localeCompare` method to sort strings in a case-sensitive manner. Here is an example:

```javascript
const arr = ['apple', 'Banana', 'cherry', 'Date', 'elderberry'];

arr.sort((a, b) => a.localeCompare(b, undefined, { sensitivity: 'case' }));

console.log(arr);
// Output: ['Banana', 'Date', 'apple', 'cherry', 'elderberry']
```

In this example, the `localeCompare` method is used as the compare function for the `sort` method. The `sensitivity` option is set to `'case'` to enable case-sensitive sorting.

Note that the `localeCompare` method is supported in modern browsers and Node.js environments. If you need to support older browsers, you can use a polyfill or a different approach.

Alternatively, you can use the `Intl.Collator` API to achieve case-sensitive sorting:

```javascript
const arr = ['apple', 'Banana', 'cherry', 'Date', 'elderberry'];

const collator = new Intl.Collator(undefined, { sensitivity: 'case' });
arr.sort(collator.compare);

console.log(arr);
// Output: ['Banana', 'Date', 'apple', 'cherry', 'elderberry


